import React from 'react'

export default function WorkPageTextSection(props) {

    let header = props.header;
    let text = props.text;

    return (
        <div className="work-page-section">
            <h1 className="work-page-section-title">{header}</h1>
            <p className="work-page-section-text">{text}</p>
        </div>
    )
}
